message: <p>It wasn't removed. Try closing the app and make sure no other instances of GitHub.exe are running. Then launch it again. It should extract it. If not, contact our support team via <a href="https://github.com/support" rel="nofollow noopener" title="https://github.com/support">https://github.com/support</a> and we'll figure it out.</p>
